							where pa.page_id_parent=',parent_id,' and p.position_id=',position_id,'
	                   GROUP BY pa.page_id_parent');
	
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END//
