CREATE FUNCTION `get_costing_invoice`(`sale_master_id` int) RETURNS decimal(11,2)
BEGIN
			DECLARE done INT DEFAULT 0;
			DECLARE result DECIMAL(11,2);
			declare item int;
			declare my_avg decimal(11,2);
			DECLARE measure_qty DECIMAL(11,2);
			DECLARE qty int;
